}

const outlineIconNames = {
  homeOutline: "HiOutlineHome",
  filmOutline: "RiMovie2Line",
  bookOutline: "HiOutlineBookOpen",
  tvOutline: "IoTvOutline",
  more: "TfiMenuAlt",
};

const iconNames = [
  { outlineIcon: "HiOutlineHome", fullIcon: "HiHome", name: "Início" },
  { outlineIcon: "RiMovie2Line", fullIcon: "RiMovie2Fill", name: "Filmes" },
  {
    outlineIcon: "HiOutlineBookOpen",
    fullIcon: "BsFillTvFill",
    name: "Livros",
  },
  { outlineIcon: "IoTvOutline", fullIcon: "HiBookOpen", name: "Séries" },
  { outlineIcon: "TfiMenuAlt", fullIcon: "TfiMenuAlt", name: "Mais" },
];

const fullIconNames = {
  homeFull: "HiHome",
  filmFull: "RiMovie2Fill",
  tvFull: "BsFillTvFill",
  bookFull: "HiBookOpen",
  more: "TfiMenuAlt",
};

export default function BottomNavigationMenu() {
  return (
    <MenuWrapper>
      {iconNames.map((element) => {
        <MenuIcon
          outlineIcon={element.outlineIcon}
          fullIcon={element.fullIcon}
          name={element.name}
        />;
      })}
    </MenuWrapper>
  );
}

const MenuWrapper = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  display: flex;
  height: 100px;
  width: 100vw;
  background-color: magenta;
  align-items: center;
  justify-content: space-around;
`;

const IconWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: auto;
  height: 60px;
